import React, {Component} from 'react';
import Registration from './auth/Registration';

export default class Home2 extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div>
                <h1>Home</h1>
                <h1>Status: {this.props.loggedInStatus}</h1>
                <Registration/>
            </div>
        );
    }
}
